import Navbar from '../Components/HomeNavbar'
import { useParams } from "react-router-dom";

function Book(){
    const { bookId } = useParams();

    return (
        <div>
          <Navbar use="Guest"/>
          <div id="body">
            {bookId}
          </div>
        </div>
      );
}

export default Book;
